import { Button, Container, Grid, styled } from "@mui/material";

function App() {

  const RedButton = styled(Button)(({theme})=>({
    // backgroundColor:theme.palette.myColor.main,
    padding:5,
    margin:2,
    color:"black",
    "&:hover":{
      backgroundColor:"green",
      color:"black",
    }
  }))

  return (
    <div>
      <Button variant="text" color="prim">Text</Button>
      <Button variant="contained">Contained</Button>
      <Button variant="outlined">Outlined</Button>
      <RedButton>Everyone Okay</RedButton>
    </div>
  );
}

export default App;
